import React, { useState, useEffect } from 'react';
import { color, font } from '../../layout/main';

const Title = () => {
  const [queque, setQueque] = useState([]);
  useEffect(()=> {
    setQueque(Array(50).fill(`\&nbspGREENPOST * `));
  })
  return(
    <div>
      <ul>
        {
          queque.map(word => <li>{word}</li>)
        }
      </ul>
      <style jsx >{`
        ul{
          list-style: none;
          margin: 0;
          padding: 0;
          color: ${color.prim};
          display: flex;
          width: 150%;
        }
        li{
          flex-shrink: 0;
        }
      `}
      </style>
    </div>
  )
}

const Main = () => {
  return(
    <div className="main">
      <Title />
    </div>
  )
}

export default Main;
